export function populateEmojiPanel(emojiPanel, editor, showToast) {
  emojiPanel.innerHTML = '';
  
  emojiCategories.forEach(category => {
    const categoryTitle = document.createElement('div');
    categoryTitle.className = 'emoji-category';
    categoryTitle.textContent = category.name;
    emojiPanel.appendChild(categoryTitle);
    
    category.emojis.forEach(emoji => {
      const emojiBtn = document.createElement('button');
      emojiBtn.className = 'emoji-btn';
      emojiBtn.textContent = emoji;
      emojiBtn.addEventListener('click', () => {
        document.execCommand('insertHTML', false, emoji);
        editor.focus();
        if (showToast) showToast(`Ø¦ÛŒÙ…Û†Ø¬ÛŒ ${emoji} Ø²ÛŒØ§Ø¯Ú©Ø±Ø§`);
      });
      emojiPanel.appendChild(emojiBtn);
    });
  });
}